import React, { useEffect, useState } from "react";
import {
  Container,
  Typography,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
  LinearProgress,
  Box,
} from "@mui/material";

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3000/api/data")
      .then((response) => response.json())
      .then((data) => setData(data));
  }, []);

  return (
    <Container>
      <Typography variant="h4" gutterBottom mt={4}>
        Funnel Conversion Data
      </Typography>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Stage</TableCell>
            <TableCell>ACV</TableCell>
            <TableCell>Win Rate</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((row) => (
            <TableRow key={row.label}>
              <TableCell>{row.label}</TableCell>
              <TableCell>{row.acv}</TableCell>
              <TableCell>{row.qualifyPercent}%</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>

      <Typography variant="h5" mt={6}>
        Win Rate by ACV
      </Typography>
      {data.map((d) => (
        <Box key={d.label} mb={2}>
          <Typography>
            {d.label}: {d.qualifyPercent}%
          </Typography>
          <LinearProgress variant="determinate" value={d.qualifyPercent} />
        </Box>
      ))}
    </Container>
  );
}

export default App;
